import React , { useState } from 'react';

function App(){
  const styleCss = {};

  function Mclick(){
    styleCss.backgroundColor = 'green';
    console.log('clicked')
  }

  return(
    <>
    <div>
     <span> <button onClick={Mclick}>Click Me</button></span>
    </div>
    </>
  )
}

export default App;
